import { Link } from "react-router-dom";

function NavBar() {
  return (
    <nav style={{ padding: "10px", background: "#f0f0f0" }}>
      <Link to="/" style={{ marginRight: "15px" }}>Browse Classes</Link>
      <Link to="/classes" style={{ marginRight: "15px" }}>Class List</Link>
      <Link to="/admin" style={{ marginRight: "15px" }}>Admin Dashboard</Link>
      <Link to="/admin/classes">Admin Classes</Link>
    </nav>
  );
}

export default NavBar;
